import React, {useState} from "react";
import MyCounter from "./dev/components/Counter";
import MyInput from "./dev/components/Input";
import "./styles/App.css";
import MyPostItem from "./dev/components/PostItem";
import PostItem from "./dev/components/PostItem";

function App() {

    const [posts, setPosts] = useState([
        {id: 1, title: 'JavaScript', body: 'Description'},
        {id: 2, title: 'Python', body: 'Description'},
        {id: 3, title: 'Java', body: 'Description'}
    ])

    return (
        <div className="App">
            <h1>List Posts</h1>
            <MyCounter/>
            <MyInput/>
            {posts.map(post =>

                <div>
                    <PostItem post={post} key={post.id}/>
                </div>)}
        </div>);
}

export default App;
